import './App.css';

function App() {

  const grid = new Array(16);
  const letters = ['A', 'B', 'C', 'D', 'E', 'F', 'G', 'H']

  //creating the grid positions for the letters

  const compareLetter = (letter, posValue) => letter === posValue;

  for (var i = 0; i < letters.length; i++) {
    for (var j = 0; j < 2; j++) {
      let randomIndex;
    let gridPos;
      do {
        randomIndex = Math.floor(Math.random() * 16);
        gridPos = grid[randomIndex];
      } while (letters.findIndex((letter) => compareLetter(letter, posValue)) !== -1);
      grid[randomIndex] = letters[i];
    }
  }
  console.log(grid.toString());

  return (
    <div className="App">
      <h1>Hello World</h1>

    </div>
  );
}

export default App;
